webpackJsonp([0x7710dff63374],{350:function(A,a){A.exports={data:{site:{siteMetadata:{title:"Apifarms",author:"ApiFarms"}},markdownRemark:{id:"/Users/Alex-TBS/Documents/code/bee-project/src/pages/bee-catching/index.md absPath of file >>> MarkdownRemark",html:'<p>We offer swarm extractions.</p>\n\n  <a class="gatsby-resp-image-link" href="/static/ottawa_sign_bees-c81445825d3ad4f827bf7ea97546aa0d-99c36.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Bee swarm on a Ottawa highway sign" title="" src="/static/ottawa_sign_bees-c81445825d3ad4f827bf7ea97546aa0d-f8fb9.jpg" srcset="/static/ottawa_sign_bees-c81445825d3ad4f827bf7ea97546aa0d-e8976.jpg 148w,\n/static/ottawa_sign_bees-c81445825d3ad4f827bf7ea97546aa0d-63df2.jpg 295w,\n/static/ottawa_sign_bees-c81445825d3ad4f827bf7ea97546aa0d-f8fb9.jpg 590w,\n/static/ottawa_sign_bees-c81445825d3ad4f827bf7ea97546aa0d-85e3d.jpg 885w,\n/static/ottawa_sign_bees-c81445825d3ad4f827bf7ea97546aa0d-d1924.jpg 1180w,\n/static/ottawa_sign_bees-c81445825d3ad4f827bf7ea97546aa0d-9452e.jpg 1770w,\n/static/ottawa_sign_bees-c81445825d3ad4f827bf7ea97546aa0d-99c36.jpg 3024w" sizes="(max-width: 590px) 100vw, 590px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>Swarms can appear in lots of places and we are happy to offer the service of capturing the swarm. We would do that for free and we always guarantee that we will take great care of them. </p>\n<p>Swarming is when bees leave their hives and go feral, we capture those swarms in order to ensure their health. Capturing swarms can be complicated at times, every situation is evaluated differently.</p>\n<p>If you come by a bee swarm please <a href="/contact">contact us</a>.</p>',frontmatter:{title:"Bee catching services",date:"December 10, 2017",exclude_hr:null,exclude:null}}},pathContext:{slug:"/bee-catching/"}}}});
